如果<strong>当前对象this大于形参对象obj</strong>， 则<strong>返回正整数</strong>，如果<strong>当前对象this小于形参对象obj</strong>， 则返回<strong>负整数</strong>，如果当前对象this<strong>等于</strong>形参对象obj， 则返回<strong>零</strong>。<br>
